import styles from 'styled-components';

const Form = styles.div`

    width: 80%;
    input: {
        width: 100px;
        height: 20px;
    }
`

function Login() {
    return (
        <div>
            <Form>
                <label htmlFor="">Username:</label>
                <input type="text"/>
            </Form>
        </div>
    )
}

export default Login
